     def solveNQueens(self, n):
         """
         :type n: int
         :rtype: List[List[str]]
         """
         row = [x for x in range(n)]
         table = []
         for i in range(n):
             table.append(row.copy())
         result = self.solve(table,0)
         result_str=[]
         for x in result:
             table_str = []
             for y in x:
                 table_str.append("."*y+"Q"+"."*(n-y-1))
             result_str.append(table_str)
         return result_str
     def solve(self,table,n):
         if table[n]==[]:return []
         elif n==len(table)-1:
             table[n] = table[n][0]
             return [table]
         else:
             result=[]
             for x in table[n]:
                 table1 = [(x if type(x)==int else x.copy()) for x in table]
                 table1[n] = x
                 for row in range(n+1,len(table)):
                     if x in table1[row]:
                         table1[row].remove(x)
                     if x+row-n in table1[row]:
                         table1[row].remove(x+row-n)
                     if x-(row-n) in table1[row]:
                         table1[row].remove(x-(row-n))
                 result.extend(self.solve(table1,n+1))
             return result

class Solution:
     def __init__(self):
         self.result = []
         self.visited = None

     def solveNQueens(self, n):
         """
         :type n: int
         :rtype: List[List[str]]
         """
         self.visited = [0 for i in range(n)]
         self.__solve_n_queues(n, 0, [])
         return self.result

     @staticmethod
     def __not_diagonal(x, y, curr_answer):
         for c_x, c_y in enumerate(curr_answer):
             if abs(c_x - x) == abs(c_y - y):
                 return False
         return True

     @staticmethod
     def visualize(curr_answer, n):
         answer = []
         for pos in curr_answer:
             answer.append('.' * pos + 'Q' + '.' * (n - pos - 1))
         return answer

     def __solve_n_queues(self, n, level, curr_answer):
         if level == n:
             self.result.append(Solution.visualize(curr_answer, n))
             return

         for i in range(n):
             if not self.visited[i] and Solution.__not_diagonal(level, i, curr_answer):
                 self.visited[i] = 1
                 curr_answer.append(i)
                 self.__solve_n_queues(n, level + 1, curr_answer)
                 curr_answer.pop()
                 self.visited[i] = 0

